import "./Pages.css";
const Home = () => {
  // const [foodCategory, setFoodCategory] = useEffect([]);
  // const [foodItems, setFoodItems] = useEffect([]);

  const loadData = async () => {
    const url = "http://localhost:5000/api/foodData";
    const options = {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
    };

    const response = await fetch(url, options);
    const data = await response.json();

    console.log(data);

    // setFoodItems(data.data);
  };

  return (
    <div>
      <div>
        <Navbar />
      </div>
      <div className="banner">
        <Carousal />
      </div>
      <div className="container">
        <Card />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
};

export default Home;
